To understand what a RESTful API is, we need to understand what an API is. API stands for " A pplication P rogramming I nterface" and is "a computing interface that defines interactions between multiple software intermediaries. It defines the kinds of calls or requests that can be made, how to make them, the data formats that should be used, the conventions to follow" - Wikipedia. We can think of an API almost as a set of rules and conditions that we expect software to adhere to. There is no magic to this-- we can define an API any way we like. Let's define a simple one: Our API (version 1.0): You give me any number, and I'll return that number. You give me any two numbers, and I'll give you their product. That's all it takes! The above is a totally legit API. Just a list of bullet points. An API is just a way to define a set of rules. It was invented to allow software developers to modularize their code. You could take the above API definition, hand it to any software developer, and they can write the code that adheres to the rules. E.g. Input x, y: If y is Undefined Set y = 1 Return (x * y) But this API isn't fool-proof... What happens if we were given something other than numbers? We can totally add or multiply 'a' and 'b', but it might not be what you expect. For example, in JavaScript: console.log('a' + 'b');
// Returns 'ab'
console.log('a' * 'b');
// Returns NaN (Not A Number) Luckily we can extend an API. Let's say version 1.0 is deprecated and everyone must use our newly extended API: Our API (version 2.0): You give me any number, and I'll return that number. You give me any two numbers, and I'll give you their product. Can only enter numbers, entering anything else returns an error message. E.g. Input x, y: If x is Undefined Return Error If x isNot Number Return Error If y is Undefined Set y = 1 If y isNot Number Return Error Return x * y The nice thing about this is you could define multiple API specifications and then stitch them all together. An API, for example, can be the bridge between two software developers. Bob is writing some code for a Math library and needs a function for multiplication. Jim has some free time and can write the multiplication code. Bob and Jim agree on an API, such that as long as Jim's code meets the API definition, we can combine the two pieces of code together when they have both finished. Modularization. Our list of bullet-points totally works, but code is much more succinct, and can be Type checked. In Typescript, Bob can define the interface as a function. Same as our bullet-points, the function takes a number and a second optional number. It then returns a number. He can then continue on his day writing other code that would call this function: interface IMath { multiply: (x:Number, y?:Number) => Number
} Jim would then write the implementation. Same as the bullet-point logic; If the type of the first input isn't a number, return an error. If the type of the second input isn't defined, we set it to 1. If the second input was defined, but it's not a number, return an error. Otherwise if all is good, return the multiplication of the two inputs: var math:IMath = { multiply: (x:Number, y?:Number) => { if(typeof x !== 'number') throw new Error() if(typeof y === 'undefined') y = 1 if(typeof y !== 'number') throw new Error() return x * y }
} Bob could then use Jim's implementation in his code: console.log(math.multiply(2)) // 2
console.log(math.multiply(2,3)) // 6 Voila, we are interface masters. just created a simple interface and the implementation of that interface... Remember that API stands for Application Programming Interface ? This basically means that a whole Application has an Interface . So a better example of an API versus just the I might look more like this: interface IMath { add: (x:Number, y?:Number) => Number subtract: (x:Number, y?:Number) => Number multiply: (x:Number, y?:Number) => Number divide: (x:Number, y?:Number) => Number
}

