REST stands for " RE presentational S tate T ransfer" and a RESTful Web service is required to provide an application access to its Web resources in a textual representation. - Wikipedia This interpretation doesn't win awards for being clear. A RESTful API could be many things, but the community has largely accepted that sending Http Requests and Responses in a certain manner constitutes as RESTful. A RESTful API is the bridge between the "Frontend" and "Backend" code that is needed to build a web application. They communicate via the API. Backend code is usually the server that connects to a database and performs business logic on said data before sending it to a Frontend. The Frontend is usually an application that runs in the browser that makes the business logic and data make sense to users. The Frontend also handles user input and interactions. Why split the two? Again, for Modularization. The two areas have become complex enough that they require more expertise. Thus web applications are largely split. For us to build a RESTful API we need to focus on three attributes of an Http Request: Method Path Body Request Headers are important for Http, frameworks, and Auth. However, for basic RESTful model design, we won't worry about them. Request { Path: String Body: String | Object Method: String Headers: Object
} The Http Request Path is the URL endpoint. If we had a URL such as https://my-website.com/api/users the path would be /api/users. Request { Path: "/api/users"
} The Body of an Http Request is the data the Request contains. For our purposes, this will be a JSON document with info we want to send to our service. Request { Body: { name: "John", age: 30 }
} An Http Request Method is usually one of the following; GET, PUT, POST, DELETE. (There are many others, but these are the most common). Request { Method: "POST"
} With the above three attributes, we can build a RESTful service for a User resource (often called a Model). The most common, and usually the default way to represent state transfer for a model is called "CRUD" which stands for Create, Read, Update, and Delete. This makes sense as if we have a User model, we would likely want to create users, retrieve users, update them, and perhaps delete them. Say we want to get the users from our service, we'd send an Http Request with the method set to GET and the path set to /api/users : Note that we don't need to send any info in the Body to retrieve users. GetUsersRequest { Path: "/api/users" Body: {} Method: "GET"
} And if we wanted to create a new user: AddUserRequest { Path: "/api/users" Body: { name: "John", age: 30 } Method: "POST"
} And if we wanted to update the user's age (we need the ID of the user in the Path): UpdateUserRequest { Path: `/api/users/<user-id>` Body: { name: "John", age: 31 } Method: "PUT"
} And if we wanted to delete the user (we need the ID of the user in the Path): DeleteUserRequest { Path: `/api/users/<user-id>` Body: {} Method: "DELETE"
} With the above RESTful API defined, the Frontend developers can build an application that queries for users. Similarly, the backend developers can build their code to serve up users and ways to modify users. Once both sides have completed their code, the whole system works together.

